svg.script:
var rects = document.querySelectorAll('rect');
for (var i = 0; i < rects.length; ++i) {
    rects[i].addEventListener('mousemove', function(e) {
        var svg = document.querySelector('svg');
        var text = e.target.parentNode.querySelector('text');
        var svgRect  = svg.getBoundingClientRect();
        var textRect = text.getBoundingClientRect();
        var maxRight  = Math.min(svgRect.width,  window.scrollX + window.innerWidth);
        var maxBottom = Math.min(svgRect.height, window.scrollY + window.innerHeight);
        var newX = Math.min(e.pageX + 8, maxRight - textRect.width);
        var newY = Math.min(e.pageY + 8 + textRect.height, maxBottom);
        text.setAttribute('x', newX);
        text.setAttribute('y', newY);
    });
}
